const PhonecasesPage = (props) => {
    const {allPhonecases} = props;
    return ( 
        <>
        <section className="phonecases-container">
            {allPhonecases.map((phonecase) => {
                return(
                    <>
                    <div key={phonecase.id}>
                        {phonecase.name}
                        {phonecase.category}
                        {phonecase}
                        </div>
                    </>
                )
            })}
        </section>
        </>
     );
}

export default PhonecasesPage;
